 Windows, macOS, and Linux using technologies like Electron, .NET, and JavaScript.</p>\\"}, \\"id\\": \\"1af82d77-a0e2-475e-a379-587f041c0b30\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"analytics\\", \\"title\\": \\"Data Analysis\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">Data analysis is crucial for businesses and organizations to make informed decisions, identify trends, and optimize operations. Our data analysis services include data collection, processing, visualization, and interpretation using our inhouse tools and programming languages like Python, R, and SQL.</p>\\"}, \\"id\\": \\"1d0c363f-9a22-4b90-ab98-38c6969ed98f\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"psychology\\", \\"title\\": \\"Machine Learning\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">Machine learning is a powerful technology that enables businesses and organizations to automate processes, make predictions, and improve decision-making. Our machine learning services include building, training, and deploying machine learning models using popular frameworks like TensorFlow, PyTorch, and scikit-learn, and programming languages like Python and R.</p>\\"}, \\"id\\": \\"b014e4e5-2f25-4538-a8e6-5c1c4d56d78a\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"travel_explore\\", \\"title\\": \\"Web Scraping\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">Web scraping is essential for businesses and organizations to extract data from websites, monitor competitors, and gather market intelligence. Our web scraping services include building and deploying web scrapers using technologies like Python, JavaScript, and frameworks like Scrapy and Beautiful Soup, to extract data from websites and store it in a structured format.</p>\\"}, \\"id\\": \\"a847f7a0-09fe-4d04-984f-4d7f5d658e6e\\"}]", "url_path": "/home/", "expire_at": null, "locked_at": null, "locked_by": null, "seo_title": "", "go_live_at": null, "hero_image":